import React, { useEffect } from "react";

import NavBar from "../components/NavBar/NavBar.js";
import Timeline from "../components/Timeline/Timeline.js";
import SideBar from "../components/SideBar/SideBar.js";

/* images */
import logoHomeBig from "../../images/icons/outline_home_white_24dp_2x.png";

export default function Dashboard(){

    useEffect( () => {
        document.title = "Dashboard - Birdy";
    }, []);

    const menuIcons = [
        {src:logoHomeBig, alt:"home menu", msg:"Home"},
        {src:logoHomeBig, alt:"explore menu", msg:"Explore"},
        {src:logoHomeBig, alt:"more option menu", msg:"More"}
    ];

    return(
        <div className="dahsboard row max-height">
            <NavBar menuIcons={menuIcons}/>
            <Timeline />
            <SideBar />
        </div>
    )
};
